Rest - Representational state transfer Api - application programming interface pip install djangorestframework and add it to the Installed apps in settings.py: INSTALLED_APPS = [ .... 'rest_framework', ....
] The rest framework needs a serializer. The serializer explains how to format the db data into formats like json etc. in a get request or how to format a post request for data that goes into the db. The normal serializer class is written the same way as the model class with special methods to handle requests (get, post etc.). Because of these similarities in structure and API duties, the class can be simplified with Modelserializers. This can be as simple as: from rest_framework import serializers
from app.models import Modelname class AppSerializer(serializers.ModelSerializer): class Meta: model = App fields = ['id', 'title', 'other', 'important', 'fields'] The implementation can be checked in the django shell by importing the serializer and calling $ print(repr(Serializername())) Just like the Serializer often has similar tasks, the API IO is also normally fairly similar. Therefore, the view necessary to make the api connect with the outer world, can be simplified using generic class based views. An API that retrieves all elements of a database with a get request can be implemented like this: from App.models import Modelname
from app.serializers import AppSerializer
from rest_framework import generics class SnippetList(generics.ListCreateAPIView): queryset = App.objects.all() serializer_class = AppSerializer and an API that retrieves, stores or deletes a single db entry: class AppDetail(generics.RetrieveUpdateDestroyAPIView): queryset = App.objects.all() serializer_class = AppSerializer More about generic views can be found here . Note: in the urls file, class based views need the .asview method attached. To be able to use api suffixes (.json, .api) remember to modify the urlpatterns with urlpatterns = format_suffix_patterns(urlpatterns) Permissions can be handled with the permission classes in the generic views (rest_framework permissions need to be imported): class SnippetDetail(generics.RetrieveUpdateDestroyAPIView): permission_classes = [permissions.IsAuthenticatedOrReadOnly, IsOwnerOrReadOnly] In this example, "IsownerOrReadOnly" is a custom method defined in a permissions.py file. Documentation can be found here Authentication is built into the Rest framework and just needs to be included into the project level urls.py file: urlpatterns += [ path('anypath/', include('rest_framework.urls')),
] Pagination and Hyperlinking in a nutshell: Let the serializer do the work. Make sure URL names fit and let the serialiser class inherit the HyperlinkedModelSerializer.
